import React from 'react';

const Signup = () => {

  const style = {
    margin : "20px",
  }

  const labelDiv = {
    border : "none",
    display : "inline-block",
    padding : "10px",
    marginTop : "10px",
    backgroundColor : "#CACACA",
    color : "white"
  }

  const labelFont = {
    fontSize : "20px",
  }

  return (
    <div style={style}>
      <div>
        <h1>회원가입</h1>
      </div>
      <hr />
      <div style={labelDiv}>
        <span style={labelFont}>Member Type</span>
      </div>
      <div style="marginTop:10px">
        <span>가입하실 회원구분을 선택해주세요</span>
      </div>

    </div>

  );
};

export default Signup;
